    public static populate() {
        localStorage.clear();
        this.populateEvents();
        this.populateUsers();
        this.populateChat();
        this.populatePoll();
        this.populateShops();
    }

    public static populateEvents() {
        for (let event of PopulationService.EVENTS) {
            EventService.saveEvent(event);
        }
    }
    public static populateUsers() {
        for (let user of PopulationService.USERS) {
            UserService.saveUser(user);
        }
    }
    public static populateChat() {
        for (let message of this.CHAT) {
            MessageService.saveMessage(message);
        }
    }
    public static authentificateFirstUser() {
        UserService.authentificateUser(this.USERS[0].username, this.USERS[0].password);
    }

    public static populateShops(){
        for (let shop of PopulationService.SHOPS) {
            ShopService.saveShop(shop);
        }

    }

    public static populatePoll() {
        for (let poll of this.POLLS) {
            PollService.savePoll(poll);
        }
    }
